 //偏移}</code></td></tr><tr><td>follow</td><td>Boolean</td><td>false</td><td>标记图标是否跟随鼠标。</td></tr></tbody></table><h3 id="事件" tabindex="-1">事件 <a class="header-anchor" href="#事件" aria-label="Permalink to &quot;事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th>事件</th><th>参数</th><th>描述</th></tr></thead><tbody><tr><td>mark-mouseup</td><td>({type,target,currentLnglat,<br>currentMarker,allMarkers})</td><td>在用户每完成一次标注时触发事件</td></tr></tbody></table><h2 id="多边形工具" tabindex="-1">多边形工具 <a class="header-anchor" href="#多边形工具" aria-label="Permalink to &quot;多边形工具&quot;">​</a></h2><p>polygonTool 多边形工具，可以通过事件来获取用户绘制的多边形，包含测面积功能。</p><h3 id="属性-2" tabindex="-1">属性 <a class="header-anchor" href="#属性-2" aria-label="Permalink to &quot;属性&quot;">​</a></h3><table tabindex="0"><thead><tr><th>属性</th><th>类型</th><th>默认值</th><th>说明</th></tr></thead><tbody><tr><td>color</td><td>String</td><td>&quot;#0000FF&quot;</td><td>多边形边线颜色。</td></tr><tr><td>weight</td><td>Number</td><td>3</td><td>多边形边线的宽度，以像素为单位。</td></tr><tr><td>opacity</td><td>Number</td><td>0.5</td><td>多边形边线的透明度（范围 0-1 之间）。</td></tr><tr><td>fillColor</td><td>String</td><td>&quot;#0000FF&quot;</td><td>多边形填充颜色。当参数为空时，折线覆盖物将没有填充效果。</td></tr><tr><td>fillOpacity</td><td>Number</td><td>0.2</td><td>多边形填充的透明度（范围 0-1 之间）。</td></tr><tr><td>lineStyle</td><td>String</td><td>&quot;solid&quot;</td><td>多边形边线的样式（solid 或 dashed）。</td></tr><tr><td>showLabel</td><td>Boolean</td><td>false</td><td>是否显示面积，如果不显示面积，则可以作为画面控件使用，默认值为 false。</td></tr></tbody></table><h3 id="事件-1" tabindex="-1">事件 <a class="header-anchor" href="#事件-1" aria-label="Permalink to &quot;事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th>事件</th><th>参数</th><th>描述</th></tr></thead><tbody><tr><td>polygon-draw</td><td>({type,target,currentLnglats,currentArea,<br>currentPolygon,allPolygons})</td><td>用户双击完成一次折线绘制时触发事件。</td></tr><tr><td>polygon-addpoint</td><td>({type,target,currentLnglats,currentArea,<br>currentPolygon,allPolygons})</td><td>用户在多边形绘制过程中，每次点击底图添加节点时触发事件。</td></tr></tbody></table><h2 id="折线工具" tabindex="-1">折线工具 <a class="header-anchor" href="#折线工具" aria-label="Permalink to &quot;折线工具&quot;">​</a></h2><p>polylineTool 折线工具，可以通过事件来获取用户绘制的折线，包含测距功能。</p><h3 id="属性-3" tabindex="-1">属性 <a class="header-anchor" href="#属性-3" aria-label="Permalink to &quot;属性&quot;">​</a></h3><table tabindex="0"><thead><tr><th>属性</th><th>类型</th><th>默认值</th><th>说明</th></tr></thead><tbody><tr><td>color</td><td>String</td><td>&quot;#0000FF&quot;</td><td>折线颜色。</td></tr><tr><td>weight</td><td>Number</td><td>3</td><td>折线的宽度，以像素为单位。</td></tr><tr><td>opacity</td><td>Number</td><td>0.5</td><td>折线的透明度（范围 0-1 之间）。</td></tr><tr><td>lineStyle</td><td>String</td><td>&quot;solid&quot;</td><td>拆线的样式（solid 或 dashed）。</td></tr><tr><td>showLabel</td><td>Boolean</td><td>false</td><td>是否显示距离，如果不显示距离，则可以作为画线控件使用，默认值为 false。</td></tr></tbody></table><h3 id="事件-2" tabindex="-1">事件 <a class="header-anchor" href="#事件-2" aria-label="Permalink to &quot;事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th>事件</th><th>参数</th><th>说明</th></tr></thead><tbody><tr><td>polyline-draw</td><td>({type,target,currentLnglats,currentDistance,<br>currentPolyline,allPolylines})</td><td>用户每次完成拉框操作时触发事件。</td></tr><tr><td>polyline-addpoint</td><td>({type,target,currentLnglats,currentDistance,<br>currentPolyline,allPolylines})</td><td>用户测距过程中，每次点击底图添加节点时触发事件。</td></tr></tbody></table><h2 id="矩形工具" tabindex="-1">矩形工具 <a class="header-anchor" href="#矩形工具" aria-label="Permalink to &quot;矩形工具&quot;">​</a></h2><p>rectangleTool 矩形工具，用来实现在地图上选择一个矩形区域或绘制矩形的功能。</p><h3 id="属性-4" tabindex="-1">属性 <a class="header-anchor" href="#属性-4" aria-label="Permalink to &quot;属性&quot;">​</a></h3><table tabindex="0"><thead><tr><th>属性</th><th>类型</th><th>默认值</th><th>说明</th></tr></thead><tbody><tr><td>color</td><td>String</td><td>&quot;#0000FF&quot;</td><td>矩形边线颜色。</td></tr><tr><td>weight</td><td>Number</td><td>3</td><td>矩形边线的宽度，以像素为单位。</td></tr><tr><td>opacity</td><td>Number</td><td>0.5</td><td>矩形边线的透明度（范围 0-1 之间）。</td></tr><tr><td>fillColor</td><td>String</td><td>&quot;#0000FF&quot;</td><td>矩形填充颜色。当参数为空时，折线覆盖物将没有填充效果。</td></tr><tr><td>fillOpacity</td><td>Number</td><td>0.2</td><td>矩形填充的透明度（范围 0-1 之间）。</td></tr><tr><td>lineStyle</td><td>String</td><td>&quot;solid&quot;</td><td>矩形边线的样式（solid 或 dashed）。</td></tr></tbody></table><h3 id="事件-3" tabindex="-1">事件 <a class="header-anchor" href="#事件-3" aria-label="Permalink to &quot;事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th>事件</th><th>参数</th><th>描述</th></tr></thead><tbody><tr><td>rectangle-draw</td><td>({type,target,currentBounds,<br>currentRectangle,allRectangles})</td><td>用户每次完成拉框操作时触发事件。</td></tr></tbody></table><h2 id="画圆工具" tabindex="-1">画圆工具 <a class="header-anchor" href="#画圆工具" aria-label="Permalink to &quot;画圆工具&quot;">​</a></h2><p>circleTool 画圆工具，用来实现在地图上画圆的功能。</p><h3 id="属性-5" tabindex="-1">属性 <a class="header-anchor" href="#属性-5" aria-label="Permalink to &quot;属性&quot;">​</a></h3><table tabindex="0"><thead><tr><th>属性</th><th>类型</th><th>默认值</th><th>说明</th></tr></thead><tbody><tr><td>color</td><td>String</td><td>&quot;#0000FF&quot;</td><td>圆边线颜色。</td></tr><tr><td>weight</td><td>Number</td><td>3</td><td>圆边线的宽度，以像素为单位。</td></tr><tr><td>opacity</td><td>Number</td><td>0.5</td><td>圆边线的透明度（范围 0-1 之间）。</td></tr><tr><td>fillColor</td><td>String</td><td>&quot;#0000FF&quot;</td><td>圆填充颜色。当参数为空时，折线覆盖物将没有填充效果。</td></tr><tr><td>fillOpacity</td><td>Number</td><td>0.2</td><td>圆填充的透明度（范围 0-1 之间）。</td></tr><tr><td>lineStyle</td><td>String</td><td>&quot;solid&quot;</td><td>圆边线的样式（solid 或 dashed）。</td></tr></tbody></table><h3 id="事件-4" tabindex="-1">事件 <a class="header-anchor" href="#事件-4" aria-label="Permalink to &quot;事件&quot;">​</a></h3><table tabindex="0"><thead><tr><th>事件</th><th>参数</th><th>描述</th></tr></thead><tbody><tr><td>circle-draw</td><td>({type,target,currentCenter,currentRadius,<br>currentCircle,allCircles})</td><td>用户拖动绘制圆时触发。</td></tr><tr><td>circle-drawend</td><td>({type,target,currentCenter,currentRadius,<br>currentCircle,allCircles})</td><td>用户完成绘制圆时触发。</td></tr></tbody></table><h2 id="画笔工具" tabindex="-1">画笔工具 <a class="header-anchor" href="#画笔工具" aria-label="Permalink to &quot;画笔工具&quot;">​</a></h2><p>paintBrushTool 在地图容器中，创建一个可以随意画线的画笔工具。</p><h3 id="属性-6" tabindex="-1">属性 <a class="header-anchor" href="#属性-6" aria-label="Permalink to &quot;属性&quot;">​</a></h3><table tabindex="0"><thead><tr><th>属性</th><th>类型</th><th>默认值</th><th>说明</th></tr></thead><tbody><tr><td>keepdrawing</td><td>Boolean</td><td>false</td><td>保持工具的连续可用性</td></tr><tr><td>color</td><td>String</td><td>&quot;#0000FF&quot;</td><td>画笔颜色。</td></tr><tr><td>weight</td><td>Number</td><td>3</td><td>画笔的宽度，以像素为单位。</td></tr><tr><td>opacity</td><td>Number</td><td>0.5</td><td>画笔的透明度（范围 0-1 之间）。</td></tr></tbody></table>`,40))])}const b=h(e,[["render",E]]);export{c as __pageData,b as default};
